import React from "react";
import './Forecast.css';

function Forecast() {
    return (
        <div>
            <span>
                Humidity
            </span>
            <span>
                Wind
            </span>
            <span>
                Rain
            </span>
            <span>
                Dust
            </span>
        </div>
    )
}

export default Forecast;
